  ['post_id' => '5','title' => 'Care for your clothes like the good friends they are','meta_title' => NULL,'meta_keywords' => NULL,'meta_description' => NULL,'identifier' => 'care-for-your-clothes-like-the-good-friends-they-are','og_title' => NULL,'og_description' => NULL,'og_img' => NULL,'og_type' => NULL,'content_heading' => 'The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from "de Finibus Bonorum et Malorum" by Cicero are also reproduced in their exact original form, accompanied by English versions ','content' => '<p>"But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure?"</p>
